import { FunctionComponent } from "react";
import Component from "./Component";
import SignIn from "./SignIn";
import SignUp from "./SignUp";
import styles from "./HeaderFinal.module.css";

import logo from "../../assets/svg/header/logo.svg"


const HeaderFinal: FunctionComponent = (
) => {
  return (
    <header className={styles.headerFinal}>
      <div className={styles.main}>
        <div className={styles.logoWrapper}>
          <img
            className={styles.logoIcon}
            loading="lazy"
            alt=""
            src={logo}
          />
        </div>
        <div className={styles.component4Parent}>
          <MenuItem title="Cards" />
          <MenuItem title="Services" />
          <MenuItem title="Business" />
          <MenuItem title="About Us" />
        </div>
      </div>
      <div className={styles.auth}>
        <SignIn />
        <SignUp />
      </div>
    </header>
  );
};

interface MenuItemProps {
  title: string;
}
const MenuItem: React.FC<MenuItemProps> = ({ title }) => {

  return (
    <div
      className={styles.menuitem}
    >
      <a className={styles.cards} >
        {title}
      </a>
    </div>
  );
};


export default HeaderFinal;
